/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `alodigaCore`.`empresa_AFTER_UPDATE` AFTER UPDATE ON `empresa` FOR EACH ROW
BEGIN
	IF NEW.estadoId = 6 THEN
		UPDATE alodigaCore.usuario
        SET estadoId = 6
        WHERE perfilAloPosId IN (
			SELECT 	perfilAloPosId
            FROM	alodigaCore.perfilAloPos
            WHERE	empresaId = NEW.empresaId
        );
        /*UPDATE saatadm.ST_ADM_AUTH_POS
        SET status_id = 2
        WHERE business_agent_id IN (
			SELECT 	usuarioId
            FROM	alodigaCore.usuario
            WHERE	perfilAloPosId IN (
				SELECT 	perfilAloPosId
				FROM	alodigaCore.perfilAloPos
				WHERE	empresaId = NEW.empresaId
			)
        );*/
    END IF;
END */;;
