/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `alodigaCore`.`usuario_AFTER_UPDATE` AFTER UPDATE ON `usuario` FOR EACH ROW
BEGIN
